"use client";

import { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import { Button } from "../components/ui/button";
import { Input } from "../components/ui/input";
import { Label } from "../components/ui/label";
import {
  Card,
  CardContent,
  CardDescription,
  CardFooter,
  CardHeader,
  CardTitle,
} from "../components/ui/card";
import { useToast } from "../components/ui/use-toast";
import { typeText } from "../lib/animations";
import { animate } from "animejs";

export default function RegisterPage() {
  const navigate = useNavigate();
  const { register } = useAuth();
  const { toast } = useToast();
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    // Apply typing effect to title
    typeText(".register-title", null, 800);

    // Apply animation to the card
    const registerCard = document.querySelector(".register-card");
    if (registerCard) {
      animate({
        targets: registerCard,
        boxShadow: [
          "0 0 5px rgba(247, 0, 255, 0.5), 0 0 15px rgba(247, 0, 255, 0.3)",
          "0 0 2px rgba(247, 0, 255, 0.5), 0 0 10px rgba(247, 0, 255, 0.3)",
          "0 0 5px rgba(247, 0, 255, 0.5), 0 0 15px rgba(247, 0, 255, 0.3)",
        ],
        duration: 2000,
        direction: "alternate",
        loop: true,
        easing: "easeInOutSine",
      });
    }
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (password !== confirmPassword) {
      toast({
        title: "Password mismatch",
        description: "Passwords do not match",
        variant: "destructive",
      });
      return;
    }

    setIsLoading(true);

    try {
      await register({ username, email, password });
      toast({
        title: "Registration successful",
        description: "Your account has been created successfully",
      });
      navigate("/");
    } catch (error) {
      toast({
        title: "Registration failed",
        description: error.message || "An error occurred during registration",
        variant: "destructive",
      });
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="container flex items-center justify-center min-h-[80vh] py-8 bg-cyber-gradient">
      <div className="absolute inset-0 bg-cyber-grid bg-[length:50px_50px] opacity-10 pointer-events-none"></div>
      <Card className="w-full max-w-md cyberpunk-card register-card border-cyberpunk-primary/50">
        <CardHeader className="space-y-1">
          <CardTitle className="text-2xl font-bold font-cyber neon-text-pink register-title">
            New Identity Creation
          </CardTitle>
          <CardDescription className="font-mono-cyber">
            Register your digital persona in the network
          </CardDescription>
        </CardHeader>
        <form onSubmit={handleSubmit}>
          <CardContent className="space-y-4">
            <div className="space-y-2">
              <Label
                htmlFor="username"
                className="font-cyber text-cyberpunk-primary"
              >
                Handle
              </Label>
              <Input
                id="username"
                placeholder="netrunner"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                required
                className="cyber-console border-cyberpunk-primary focus:border-cyberpunk-primary focus:ring-cyberpunk-primary"
              />
            </div>
            <div className="space-y-2">
              <Label
                htmlFor="email"
                className="font-cyber text-cyberpunk-primary"
              >
                Contact ID
              </Label>
              <Input
                id="email"
                type="email"
                placeholder="your.email@example.com"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                required
                className="cyber-console border-cyberpunk-primary focus:border-cyberpunk-primary focus:ring-cyberpunk-primary"
              />
            </div>
            <div className="space-y-2">
              <Label
                htmlFor="password"
                className="font-cyber text-cyberpunk-primary"
              >
                Security Key
              </Label>
              <Input
                id="password"
                type="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
                className="cyber-console border-cyberpunk-primary focus:border-cyberpunk-primary focus:ring-cyberpunk-primary"
              />
            </div>
            <div className="space-y-2">
              <Label
                htmlFor="confirmPassword"
                className="font-cyber text-cyberpunk-primary"
              >
                Verify Security Key
              </Label>
              <Input
                id="confirmPassword"
                type="password"
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
                required
                className="cyber-console border-cyberpunk-primary focus:border-cyberpunk-primary focus:ring-cyberpunk-primary"
              />
            </div>
          </CardContent>
          <CardFooter className="flex flex-col">
            <Button
              type="submit"
              className="w-full btn-cyber-pink"
              disabled={isLoading}
            >
              {isLoading ? "Processing..." : "Initialize Identity"}
            </Button>
            <p className="mt-4 text-center text-sm text-muted-foreground font-mono-cyber">
              Already in the system?{" "}
              <Link
                to="/login"
                className="text-cyberpunk-secondary neon-text hover:underline"
              >
                Login to Access
              </Link>
            </p>
          </CardFooter>
        </form>
      </Card>
    </div>
  );
}
